import "./SearchForm.css";
import { throwStatement } from '@babel/types';

class SearchForm extends Component {
    constructor(props){
        super(props);
        this.state = {roverPhotos:""}
        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }
    handleChange(e){
        this.setState({roverPhotos: e.target.value})
    }
    handleSubmit(e){
        e.preventDefault();
        this.setState({roverPhotos:""})
    }
    render() {
        return (
            <div className="SearchForm">
                <h2>Curiosity</h2>
                <form>
                    <div>
                        <label>Sol</label><br />
                        <input type="text" />
                    </div>
                    <div>
                        {/* <label></label> */}
                        <select></select>
                    </div>
                    <input className="SearchForm-button" type="submit" value="Find Photos" />
                </form>
            </div>
        );
    }
}


export default SearchForm;
